INSERT INTO `ownerfiles` VALUES (1,'connect.jsp','manjunath','<title>SDS | Database Connectivity</title><%@ page import=\"java.sql.*\"%>\r\n<%@ page import=\"java.util.*\" %>\r\n<%\r\n	Connection connection = null;\r\n 	try {\r\n     	// ORACLE DBASE CONECTIVITY\r\n		/*\r\n      	Class.forName(\"oracle.jdbc.driver.OracleDriver\");\r\n      	DriverManager.registerDriver(new oracle.jdbc.driver.OracleDriver());\r\n		connection =  DriverManager.getConnection (\"jdbc:oracle:thin:@localhost:1521:insurance\",\"scott\", \"tiger\");   \r\n	\r\n      	//MY SQL DBASE CONNECTIVITY \r\n\r\n       	Class.forName(\"com.mysql.jdbc.Driver\");\r\n       	Connection=DriverManager.getConnection(\"jdbc:mysql://localhost:5053/AMES\");\r\n\r\n		*/\r\n\r\n  		// MS ACCESS and MYSQL DBASE CONNECTIVITY\r\n\r\n	  	Class.forName(\"com.mysql.jdbc.Driver\");	\r\n		connection = DriverManager.getConnection(\"jdbc:mysql://localhost:3306/sds\",\"root\",\"root\");\r\n      	String sql=\"\";\r\n\r\n	}\r\n	catch(Exception e)\r\n	{\r\n		System.out.println(e);\r\n	}\r\n%>','13/06/2016   14:07:25'),(2,'cloudauth.jsp','manjunath','<title>Authentication Page</title>\r\n<%@ include file=\"connect.jsp\" %>\r\n<%@ page import=\"java.util.Date\" %>\r\n<%\r\n   	String name=request.getParameter(\"userid\");      \r\n   	String pass=request.getParameter(\"pass\");\r\n	\r\n    try{\r\n			String sql=\"SELECT * FROM cloud where user=+name+ and pass=+pass+\";\r\n			Statement stmt = connection.createStatement();\r\n			ResultSet rs =stmt.executeQuery(sql);\r\n			String utype=\"\";\r\n			if(rs.next()){\r\n				response.sendRedirect(\"StorageServerMain.jsp\");\r\n			}\r\n			else\r\n			{\r\n				response.sendRedirect(\"WrongLogin.html\");\r\n			}\r\n		\r\n	}\r\n	catch(Exception e)\r\n	{\r\n		out.print(e);\r\n	}\r\n%>','13/06/2016   14:07:50'),(3,'Revoke.jsp','Harish','\r\n	<%@page import =\"java.util.*\"%>\r\n<%@ include file=\"connect.jsp\" %>\r\n    <%@page import =\"java.util.*,java.security.Key,java.util.Random,javax.crypto.Cipher,javax.crypto.spec.SecretKeySpec,org.bouncycastle.util.encoders.Base64\"%>\r\n    <%@ page import=\"java.sql.*,java.util.Random,java.io.PrintStream,java.io.FileOutputStream,java.io.FileInputStream,java.security.DigestInputStream,java.math.BigInteger,java.security.MessageDigest,java.io.BufferedInputStream\" %>\r\n<%@ page import =\"java.security.Key,java.security.KeyPair,java.security.KeyPairGenerator,javax.crypto.Cipher\"%>\r\n <%@page import =\"java.util.*,java.text.SimpleDateFormat,java.util.Date,java.io.FileInputStream,java.io.FileOutputStream,java.io.PrintStream\"%>\r\n\r\n\r\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\" \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\r\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\r\n<head>\r\n<meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\" />\r\n<title>Home Page:: SDS</title>\r\n<meta name=\"keywords\" content=\"star, css templates, CSS, HTML\" />\r\n<meta name=\"description\" content=\"Star is a free CSS template from templatemo.com\" />\r\n<link href=\"templatemo_style.css\" rel=\"stylesheet\" type=\"text/css\" />\r\n<style type=\"text/css\">\r\n<!--\r\n.style1 {\r\n	color: #FF0000;\r\n	font-weight: bold;\r\n}\r\n-->\r\n</style>\r\n</head>\r\n<body>\r\n<div id=\"templatemo_wrapper\">\r\n	<div id=\"templatemo_left_column\">\r\n        <div id=\"site_title\">\r\n            <h1><a href=\"http://www.tmksinfotech.com/page/1\" target=\"_parent\"><span>Secure Data Sharing in Cloud Computing Using Revocable Storage Identity Based Encryption</span></a></h1>\r\n            <p>&nbsp;</p>\r\n        </div> <!-- end of site_title -->\r\n        \r\n        <div id=\"templatemo_sidebar\">\r\n        \r\n        	<div class=\"service_section\">\r\n            \r\n            	<h2 align=\"center\">Storage Server Menu</h2>\r\n        \r\n              <div align=\"center\">\r\n                  <ul class=\"service_list\">\r\n                    \r\n                  </ul>\r\n              </div>\r\n                <ul class=\"service_list\">\r\n				<li><a href=\"StorageServerMain.jsp\">Home</a></li>\r\n               \r\n                    <li><a href=\"index.html\">Log Out </a></li>\r\n              </ul>\r\n\r\n			</div>\r\n            \r\n            <div class=\"news_section\">\r\n            \r\n            	<h2>Concepts</h2>\r\n            	<div class=\"news_box\">\r\n                        <h3><a href=\"#\">Cloud computing, Data sharing, Revocation, Identity-based encryption</a></h3>\r\n              </div>\r\n            \r\n            <div class=\"news_box\">\r\n                        <h3><a href=\"#\">ciphertext update, decryption key exposure,Data confidentiality,<br />\r\n                        Backward secrecy,<br />\r\n                        Forward secrecy</a></h3>\r\n              </div>\r\n            \r\n            <div class=\"cleaner_h20\"></div>\r\n            <div class=\"button\"><a href=\"#\">Read all</a></div>\r\n            \r\n            </div>\r\n                    \r\n        </div>\r\n    \r\n    </div> <!-- end of left column -->\r\n    \r\n    <div id=\"templatemo_right_column\">\r\n    \r\n    	<div id=\"templatemo_menu\">\r\n    \r\n            <ul>\r\n                <li><a href=\"\" target=\"_parent\" >Home</a></li>\r\n                <li><a href=\"\" target=\"_parent\">Data Provider </a></li>\r\n                <li><a href=\"\" target=\"_parent\" >Storage Server </a></li>\r\n                <li><a href=\"\" >Key Authority </a></li>\r\n                <li><a href=\"\" target=\"_parent\">Users</a></li>\r\n				\r\n                \r\n            </ul>\r\n        \r\n        </div> <!-- end of templatemo_menu -->\r\n        \r\n        <div id=\"templatemo_content_wrapper\">\r\n        \r\n        	<div id=\"templatemo_content\">\r\n       			\r\n                <h2>Un Revoke User Details </h2>\r\n                <p>&nbsp;</p>\r\n                <p>&nbsp;</p>\r\n                <p><br />\r\n</p>\r\n                \r\n              <div class=\"cleaner_h20\">\r\n                <div align=\"justify\" class=\"style1\">\r\n				\r\n				\r\n				   <%\r\n						try \r\n					{\r\n	\r\n					\r\n					String uname=request.getParameter(\"uname\");\r\n          			String query=\"delete from attacker where user=+uname+  \"; \r\n           		    Statement st=connection.createStatement();\r\n					st.executeUpdate(query);\r\n		\r\n		\r\n					}\r\n					\r\n					catch(Exception e)\r\n        		  {\r\n            		out.println(e.getMessage());\r\n          		   }		  \r\n              	%>\r\n			  \r\n		<h2> User Un Revoked Successfully...................... </h2>\r\n			 \r\n				</div>\r\n              </div>\r\n                \r\n                \r\n                \r\n                <div class=\"button\"><a href=\"#\">SDS</a></div>\r\n                \r\n            </div>\r\n        \r\n        </div> <!-- end of templatemo_content_wrapper --><div id=\"templatemo_content_bottom\"></div>\r\n    \r\n    </div>\r\n\r\n</div> <!-- end of templatemo_wrapper -->\r\n\r\n<div id=\"templatemo_footer_wrapper\">\r\n\r\n	</body>\r\n</html>','13/06/2016   15:26:38'),(4,'Skey.jsp','Harish','<%@page import =\"java.util.*\"%>\r\n<%@page import =\"java.sql.*\"%>\r\n<%@page import =\"java.util.*,java.security.Key,java.util.Random,javax.crypto.Cipher,javax.crypto.spec.SecretKeySpec,org.bouncycastle.util.encoders.Base64\"%>\r\n<%@ page import=\"java.sql.*,java.util.Random,java.io.PrintStream,java.io.FileOutputStream,java.io.FileInputStream,java.security.DigestInputStream,java.math.BigInteger,java.security.MessageDigest,java.io.BufferedInputStream\" %>\r\n<%@ page import =\"java.security.Key,java.security.KeyPair,java.security.KeyPairGenerator,javax.crypto.Cipher\"%>\r\n<%@page import =\"java.util.*,java.text.SimpleDateFormat,java.util.Date,java.io.FileInputStream,java.io.FileOutputStream,java.io.PrintStream\"%>\r\n<%@ include file=\"connect.jsp\" %>\r\n\r\n\r\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\" \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\r\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\r\n<head>\r\n<meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\" />\r\n<title>Home Page:: SDS</title>\r\n<meta name=\"keywords\" content=\"star, css templates, CSS, HTML\" />\r\n<meta name=\"description\" content=\"Star is a free CSS template from templatemo.com\" />\r\n<link href=\"templatemo_style.css\" rel=\"stylesheet\" type=\"text/css\" /></head>\r\n<body>\r\n<div id=\"templatemo_wrapper\">\r\n	<div id=\"templatemo_left_column\">\r\n        <div id=\"site_title\">\r\n            <h1><a href=\"http://www.templatemo.com/page/1\" target=\"_parent\"><span>Secure Data Sharing in Cloud Computing Using Revocable Storage Identity Based Encryption</span></a></h1>\r\n            <p>&nbsp;</p>\r\n        </div> <!-- end of site_title -->\r\n        \r\n        <div id=\"templatemo_sidebar\">\r\n        \r\n        	<div class=\"service_section\">\r\n            \r\n            	<h2>End User Menu</h2>\r\n        \r\n                <ul class=\"service_list\">\r\n                    <li><a href=\"EndUserMain.jsp\">Home</a></li>\r\n                   \r\n            		<li><a href=\"index.html\">Log Out </a></li>\r\n                    \r\n                </ul>\r\n\r\n			</div>\r\n            \r\n            <div class=\"news_section\">\r\n            \r\n            	<h2>Concepts</h2>\r\n            	<div class=\"news_box\">\r\n                        <h3><a href=\"#\">Cloud computing, Data sharing, Revocation, Identity-based encryption</a></h3>\r\n              </div>\r\n            \r\n            <div class=\"news_box\">\r\n                        <h3><a href=\"#\">ciphertext update, decryption key exposure,Data confidentiality,<br />\r\n                        Backward secrecy,<br />\r\n                        Forward secrecy</a></h3>\r\n              </div>\r\n            \r\n            <div class=\"cleaner_h20\"></div>\r\n            <div class=\"button\"><a href=\"#\">Read all</a></div>\r\n            \r\n            </div>\r\n                    \r\n        </div>\r\n    \r\n    </div> <!-- end of left column -->\r\n    \r\n    <div id=\"templatemo_right_column\">\r\n    \r\n    	<div id=\"templatemo_menu\">\r\n    \r\n            <ul>\r\n                <li><a href=\"index.html\" target=\"_parent\" >Home</a></li>\r\n               <li><a href=\"DataProvider.html\" target=\"_parent\">Data Provider </a></li>\r\n                <li><a href=\"Storage_Server.html\" target=\"_parent\">Storage Server </a></li>\r\n                <li><a href=\"Key_Authority.html\">Key Authority </a></li>\r\n                <li><a href=\"Users.html\" target=\"_parent\" class=\"current\">Users</a></li>\r\n                \r\n            </ul>\r\n        \r\n        </div> <!-- end of templatemo_menu -->\r\n        \r\n        <div id=\"templatemo_content_wrapper\">\r\n        \r\n        	<div id=\"templatemo_content\">\r\n       			\r\n                <h2>Requested Secret Key Details </h2> \r\n                </h2>\r\n                <p><strong></strong>              </p>\r\n              <form id=\"form\" name=\"form1\" method=\"post\" action=\"findsk.jsp\">\r\n            <label>\r\n              <div align=\"center\">\r\n                <p><span class=\"style5\"><br />\r\n                Enter File Name : \r\n                </span>\r\n                  <input required name=\"t14\" type=\"text\" size=\"30\" />\r\n                  <br />\r\n                  <br />\r\n                  <input type=\"submit\" name=\"Submit\" value=\"FIND SECRET KEY\" />\r\n                </p>\r\n                <p>&nbsp;                    </p>\r\n            </div>\r\n            <p align=\"center\"><span class=\"style5\"><span class=\"style6\"><span class=\"style1\">Secret Key </span>:</span> <%=application.getAttribute(\"key\")%></span>&nbsp;</p>\r\n          </form>\r\n\r\n                <strong></strong><br />\r\n</p>\r\n                \r\n              <div class=\"cleaner_h20\"></div>\r\n                \r\n                <h2> Concepts </h2>\r\n                \r\n                <p align=\"justify\" class=\"em_text\"><strong>The specific problem addressed in this paper is how to construct a fundamental identity-based cryptographical tool to achieve the above security goals. We also note that there exist other security issues that are equally important for a practical system of data sharing, such as the authenticity and availability of the shared data. But the research on these issues is beyond the scope of this paper.</strong></p>\r\n                <ul class=\"latest_work_gallery\">\r\n                    <li><a href=\"http://www.templatemo.com/page/1\" target=\"_parent\"><img src=\"images/templatemo_image_03.jpg\" alt=\"image\" /></a></li>\r\n                    <li><a href=\"http://www.templatemo.com/page/2\" target=\"_parent\"><img src=\"images/templatemo_image_04.jpg\" alt=\"image\" /></a></li>\r\n                    <li><a href=\"http://www.templatemo.com/page/3\" target=\"_parent\"><img src=\"images/templatemo_image_05.jpg\" alt=\"image\" /></a></li>\r\n                    <li><a href=\"http://www.templatemo.com/page/4\" target=\"_parent\"><img src=\"images/templatemo_image_06.jpg\" alt=\"image\" /></a></li>\r\n              </ul>\r\n                \r\n                <div class=\"button\"><a href=\"#\">SDS</a></div>\r\n                \r\n            </div>\r\n        \r\n        </div> <!-- end of templatemo_content_wrapper --><div id=\"templatemo_content_bottom\"></div>\r\n    \r\n    </div>\r\n\r\n</div> <!-- end of templatemo_wrapper -->\r\n\r\n<div id=\"templatemo_footer_wrapper\">\r\n\r\n	</body>\r\n</html>','13/06/2016   15:27:38');
